import { createRouter, createWebHistory } from 'vue-router';
import header_component from '../components/header_component.vue';

const routes = [
  { path: '/', name: 'Home', component: header_component, props: { section: 'home' } },
  { path: '/shop', name: 'Shop', component: header_component, props: { section: 'shop' } },
  { path: '/magazine', name: 'Magazine', component: header_component, props: { section: 'magazine' } },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
